  assemblies:
  - FoundationaLLM.ContextEngine
  namespace: FoundationaLLM.Context.Interfaces
  summary: Downloads newly created files from a code session.
  remarks: >-
    By newly created files we mean files that were not uploaded to the code session but were created during the code execution.

    The <code class="paramref">operationId</code> is the identifier of the file upload operation that initially uploaded the files.
  example: []
  syntax:
    content: Task<Result<CodeSessionFileDownloadResponse>> DownloadFilesFromCodeSession(string instanceId, string sessionId, string operationId, UnifiedUserIdentity userIdentity)
    parameters:
    - id: instanceId
      type: System.String
      description: The FoundationaLLM instance identifier.
    - id: sessionId
      type: System.String
      description: The identifier of the code session from where the files must be downloaded.
    - id: operationId
      type: System.String
      description: The code session file upload operation identifier.
    - id: userIdentity
      type: FoundationaLLM.Common.Models.Authentication.UnifiedUserIdentity
      description: The <xref href="FoundationaLLM.Common.Models.Authentication.UnifiedUserIdentity" data-throw-if-not-resolved="false"></xref> providing the user identity information.
    return:
      type: System.Threading.Tasks.Task{FoundationaLLM.Common.Models.Services.Result{FoundationaLLM.Common.Models.CodeExecution.CodeSessionFileDownloadResponse}}
      description: A <xref href="System.Threading.Tasks.Task" data-throw-if-not-resolved="false"></xref> producing a <xref href="FoundationaLLM.Common.Models.Services.Result%601" data-throw-if-not-resolved="false"></xref> whose value is a <xref href="FoundationaLLM.Common.Models.CodeExecution.CodeSessionFileDownloadResponse" data-throw-if-not-resolved="false"></xref> containing downloaded file records and any errors; otherwise a failed result with a domain error.
    content.vb: Function DownloadFilesFromCodeSession(instanceId As String, sessionId As String, operationId As String, userIdentity As UnifiedUserIdentity) As Task(Of Result(Of CodeSessionFileDownloadResponse))
